import { BrowserRouter, Switch, Route } from "react-router-dom";
import Home from "./Home";
import DeviceList from "./DeviceList";

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/" component={Home} />
        <Route path="/devices" component={DeviceList} />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
